import {Container, Nav, Navbar, NavLink} from "react-bootstrap";
import {Link} from "react-router-dom";

const NavBar = () =>{
    return(
        <Navbar bg="dark" variant="dark">
            <Container>
                <Link to='/' style={{textDecoration: 'none'}}>
                    <Navbar.Brand>Vaccine Hunter</Navbar.Brand>
                </Link>
                <Nav className="me-auto">
                    <NavLink to='/login'>Login</NavLink>
                    <NavLink><Link to='/register' className='text-light' style={{textDecoration: 'none'}}>Register</Link></NavLink>
                    <NavLink><Link to='/' className='text-light' style={{textDecoration: 'none'}}>Find a Pharmacy</Link></NavLink>
                </Nav>
            </Container>
        </Navbar>
    )
}

export default NavBar
